ز غوغای جهان فارق
:
پ.ن۱: عکس در زمستان ثبت شده.☃️❄
.
پ.ن۲: دودکش خانه آن همسایه مهربان که پارک علاوه بر پنچری مساوی مواردی است که الله علم ، پناه یکی از گربه های کوچه ماست.🐈
.
پ.ن۳: دیش و ال ان بی های خانه آن یکی همسایه، صرفا جهت دریافت شبکه های استانی است، نه شبکه های بلاد کفار و استغفرالله، خدایی ناکرده، شبکه های خاک برسری...☠
.
پ.ن۴: همسایه عزیز اگر می گذاشتی عصر ها اتومبیل را جلو دیوار خانه ات پارک کنیم، ما هم به شما اطلاع میدادیم یک فروند آنتن، روی سقف خانه ات سقوط کرده است.😏
.
پ.ن۵: گر تو با بد بد کنی پس فرق چیست؟🤔
.
پ.ن۶: ما محترم هستیم که به خواسته شما احترام می گذاریم، و الا قلمرو فرمانروایی شما تا همان دیوار حیاط شماست، نه بیشتر.😒
.
پ.ن۷: پرده  سبز آن اتاق چقدر به رنگ گل و گیاه پشت پنجره می آید.🌱
.
پ.ن۸: شما روی بام خانه هایتان عکس هنری می گیرید؟ اینجا آنقدر باران می بارد که شیب بام هم جلبک می بندد.💦🤳
.
پ.ن۹: شیب؟ بام؟ 🤔
.
پ.ن۱۰: گربه را کلا فراموش کردیم.😑
.
پ.ن۱۱: تو چطور رفتی آن بالا عزیز دل؟🤗
.
پ.ن۱۲: شمایی که این پست را پسندیدید، آیا آن را مطالعه کردید؟🙂
.
پ.ن۱۳: شمایی که این پست را مطالعه کردید، چرا آن را نپسندیدید؟🤔😕
.
پ.ن۱۴: چرا نگارش "پسندیدید" از "قستنطنیه" سخت تر است؟🤔
.
پ.ن۱۵: قسطنطنیه صحیح است.🙄
.
پ.ن۱۶: الو...چرا حرف نمی زنید؟😐
.
پ.ن۱۷: از چند عزیز دنبال کننده ای که فارسی بلد نیستند، عذر می طلبم.😉😏
.
پ.ن۱۸: به سبک #احسان_محمدی 😎
